export default function Animals({ level, className }: Props) {
  if (level === 0)
    return (
      <Toucan className={cn("w-[44%] left-[20%] -bottom-[11%]", className)} />
    )
  if (level === 1)
    return <Level1 className={cn("w-[57%] left-[20%]", className)} />
  if (level === 2)
    return (
      <Level2 className={cn("w-[80%] left-[8%] bottom-[10%]", className)} />
    )
  if (level === 3)
    return (
      <Level3 className={cn("w-[100%] -left-[14%] bottom-[3%]", className)} />
    )
  if (level === 4)
    return (
      <Level4 className={cn("w-[100%] left-[0%] bottom-[23%]", className)} />
    )
  return null
}

